import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person'


class App extends Component {

  state = {
    persons : [
      {name:'Rad', age:'55'},
      {name:'Tom', age:'22'},
      {name:'John', age:'34'}
    ]
  }

  switchNameHandler = () => {
    console.log('was clicked');
  }



  render() {
    return (
      <div className="App">
        <h1> Hi, I am first react App......</h1>
        <p> this is really working!</p>
        <button onClick={this.switchNameHandler} >Switch Name</button>
        <Person name={this.state.persons[0].name} age={this.state.persons[0].age} />
        <Person name={this.state.persons[1].name}  age={this.state.persons[1].age} />
        <Person name={this.state.persons[2].name}  age={this.state.persons[0].age} > My Hbbies: Recing</Person>
      </div>
    )
    // return React.createElement('div', null, React.createElement('h1', {className: "App"}, 'that this work now'));
  }
}

export default App;
